import React from 'react'
import {Stack , Typography } from '@mui/material'
import GymIcon from '../assets/icons/cat.png'

const CategoryItem = (props) => {
  return (
    <Stack type='button' alignItems='center' justifyContent='center' className='bodyPart-card'
    sx={ {
        backgroundColor : '#fff' ,
        width : '%',
        height : '150px',
        cursor : 'pointer',
        borderTop : props.bodyPart === props.item && '4px solid rgb(99, 134, 250)'   ,
        boxShadow : '0px 2px 2px gray' ,
        borderRadius: '20px' 
    }     
    }
    >
        <img src={GymIcon} style={{width : '48px' , height : '48px'}}/>
    </Stack>
  )
}

export default CategoryItem
